import AnimalItem from "./AnimalItems";

const AnimalList = ({ animals }) => {
    if(animals.length === 0){
        return <h3>アニマルが見つかりませんでした</h3>
    }
  return (
    <ul>
      {animals.map((animal) => {
        return <AnimalItem animal={animal} />;
      })}
    </ul>
  );
};

export default AnimalList;
